  \"completed\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Use
  Constraints: Users should consider the methodology used in compiling this data set,
  which involved combining input data from several disparate sources, scales, and
  timeframes. As described in the Currentness_Reference, this data set was derived
  from data layers dating as far back as the 1970s. Population data can only approximate
  urban land cover. No ground verification was conducted to determine the accuracy
  of the recently urbanized land classification that was based on population density.
  The resolution of the data set is appropriate for regional and national analyses.\",
